window.bookSummaryJSON = "<p><b>Magic has never felt so good.</b></p> <p>My memory is back. </p> <p>Magic rages through my veins, singing the song of revenge. And it tastes better than Riah’s lips on mine. </p> <p>I will find my way home no matter what Prince Thorne throws at me. I don’t care what Riah has to say. It’s too late for apologies. We’re beyond explanations. His words are empty and mean nothing. He betrayed me. He wrapped me up like a Christmas present and delivered me right to my enemy. They did this to me…but they don’t know just how strong I am.</p> <p>If they want me, well, I’d like to see them try. <i>Here I am, come and get me.</i> </p> <p>I waited 327 years for this…I will have my vengeance.</p>"; 
